const Header = () =>{
    return(
        <header>
            <h3>
                <a href="/main" onClick={(event)=>{
                        event.preventDefault(); 
                    }
                }>WEB</a>
            </h3>
        </header>
    );
}

const Nav = ({title})=>{
    const topicList = title.map((topic)=>
        <li key={topic.id}>
            <a href="#">{topic.title}</a>
        </li>
    );
    return(
       <nav>
        <ul>
            {topicList}
        </ul>
       </nav>
    );   
}

const Article = ({title,body})=>{
    return(
        <article>
            <h3>{title}</h3>
            <p>{body}</p>
        </article>
    );
}
export {Header, Nav, Article};
